:root {
// Colors
--red: rgb(227, 6, 19); // #E30613
--beige: rgba(238,236,225,1); //#EEECE1
--brown: rgba(59,55,33,1); //#3b3721
--blue: rgb(0, 92, 169); // #005CA9
--green: rgb(81, 174, 50); // #51AE32
--black: rgba(0, 0, 0, 1); // for backgrounds and paragraph text
--white100: rgba(255, 255, 255, 1); //#ffffff
--white70: rgba(255, 255, 255, .7);
--white05: rgba(255,255,255,.05);
--grey: rgb(244, 245, 248); //#f4f5f8 // for muted, hover inside black, lines, >, megamenu

--fs-xl: 40px;

--ff: 'Ubuntu', sans-serif;
}

/* primary */
$if-primary-dark: rgba(129, 5, 12, 1);// #81050c
$if-primary-light: rgba(185, 63, 62, 1); // #b93f3e
$if-primary: rgba(227, 6, 19, 1); // #E30613

/* secondary */

$if-secondary: rgba(255, 255, 255, .1);// #fc7c82
$if-secondary-dark: $if-secondary;
$if-secondary-black: $if-secondary;
$if-secondary-light: $if-secondary;

/*white to black shades */
$if-white: rgba(252, 232, 205, 1); //#fce8cd
$if-light: rgba(255,255,255,0.4); /* not used ?*/
$if-white-50: rgba(255,255,255,0.5); //#ffffff
$if-white-25: rgba(255,255,255,0.25); //#ffffff
$if-white-15: rgba(255,255,255,0.15); //#ffffff
$if-grey: rgba(252,243,238,1); // #fcf3ee
$if-dark: rgba(51,51,51,1); // #333333
$if-black: rgba(0,0,0,1); // #000000

/* notification colors */
$if-success: #198754;
$if-info: #b7d9d5; /* not used ?*/
$if-warning: #fd7e14;
$if-danger: rgba(129, 5, 12, 1);// #81050c

/* further variables */
$body-bg: #000;//#fcf3ee;
$body-color: $if-black;
$if-font-size-base: 1rem !default;
$if-content-max-width: 1000px;
$if-wrap-padding: 0 0.5rem 0 0.5rem;

$if-tabs-border-color: $if-dark;

sources.partials/globals-layout.scss:
html {
  background: var(--beige);
  scroll-behavior: smooth;
  text-transform: lowercase;
}

body {
  background: var(--beige);
  height: 100%;
  overflow-x: hidden;
}

//removing focus rings for all not-keyboard users
// consider form usability here and change!
body:not(.user-is-tabbing) .btn-check:focus,
body:not(.user-is-tabbing) .btn-primary:focus,
body:not(.user-is-tabbing) .btn-secondary:focus,
body:not(.user-is-tabbing) .accordion-button:focus,
body:not(.user-is-tabbing) input:focus,
body:not(.user-is-tabbing) select:focus,
body:not(.user-is-tabbing) textarea:focus {
  outline: none!important;
  box-shadow: none;
}

/* lazy man centering where needed :) */
.placeitemscenter { display: grid; place-items: center; }

/* froala editor css */
.fr-img-caption {
  background: $if-white;
  border-radius: 4px;
  display:block;
  margin: 0 0 20px 0;
  padding:0 0 5px 0;
  position: relative; top: 17px!important;

  img {
    width: 100%!important;
    border-radius: 4px 4px 0 0;
  }
}

.fr-inner {
  display:block;
  font-size: 12px;
  //text-transform: capitalize;
  padding: 10px 10px 5px 10px;
  margin: 0 ;
}

.fr-fic {
  border-radius: 4px;
  max-width: 100% !important;
}
.fr-dii {}

.fr-fil {
  float: left;
  margin: 0 20px 10px 0;
  position: relative; top: 5px;
}
.fr-fir {
  float: right;
  margin: 0 0 10px 20px;
  position: relative; top: 5px;
}

.topline {
  display:none;
}
.container {
  display: flex;
    flex-direction: column;
    justify-content: flex-start;
  max-width:100%!important;
  min-width: 100%!important;
  min-height: 100%!important;
  margin: 0!important;
  padding:0!important;
  width:100%!important;
}


@media only screen and (min-width: 1120px) {

  html {
    height: 100%;
  }

  .container {
    align-items: stretch;
    flex-direction: row-reverse;
  }

  .topline {
    border-top: 6px solid var(--beige);
    display:block;
    position: absolute;
      top: 30px;
      left: 3rem;
    width: 92%;
    z-index:1000;
  }

  body[class*="events"] .topline {
    border-top-color: var(--blue);
  }

  body[class*="art"] .topline {
    border-top-color: var(--red);
  }

  body[class*="writing"] .topline {
    border-top-color: var(--green);
  }



}

